  return (
    <div className="hero">
      <div className="heading">
        <h1 className="big">Hello.</h1>
        <h3 className="medium">I'm Wasif.</h3>
        <h4>I like creating and designing.</h4>
        <br />
        <h6>&lt;React&gt; &lt;Vue&gt; &lt;Node&gt;</h6>
        <h6>WPF | .NET(Core) | XAML</h6>
      </div>
    </div>
  );
};

export default Hero;
